// import react
import React from 'react'
// import react dom
import {
    Link
} from 'react-router-dom'

// import estilo
import './Menu.css'

const Menu = props => (
    <aside className="Menu">
        <nav>
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <a href="/about">About</a>
                </li>
            </ul>
        </nav>
    </aside>
)

export default Menu
